export const initialState = {
 mainPosts: [{
     id:1,
     User:{
       id:1,
       nickname: 'bombom',
     },
     content:'첫 번째 게시글 #해시테그 #익스프레스',
 }],

}

const reducer = (state = initialState, action) => {
    switch(action.type){
      default:
          return state;
    }
};

export default reducer;
